layout_user_css:
/* Tampermonkey Dashboard Dark Theme */
body {
    background-color: #1e1e1e;
    color: #e8e8e8;
}

a {
    color: #66afe9;
}

a:hover {
    color: #8ac0f4;
}

.header, .footer {
    background-color: #2e2e2e;
}

.table > thead > tr > th {
    background-color: #3e3e3e;
    border-color: #4e4e4e;
}

.table > tbody > tr:hover {
    background-color: #3e3e3e;
}

.table > tbody > tr > td {
    border-color: #4e4e4e;
}

.button, .btn {
    background-color: #4e4e4e;
    border-color: #5e5e5e;
}

.button:hover, .btn:hover {
    background-color: #5e5e5e;
}

.nav-tabs > li > a {
    background-color: #2e2e2e;
    color: #e8e8e8;
}

.nav-tabs > li.active > a {
    background-color: #3e3e3e;
    color: #ffffff;
}

